import React from 'react';
import sdata from './sdata';
import Card from './Card';


const Amazon= () =>{

    return (
        <Card 
          key    = {sdata[1].id}
          imgsrc = {sdata[1].imgsrc}
          title  = {sdata[1].title}
          stitle = {sdata[1].stitle}
          link   = {sdata[1].link}
        />
            );
}


export default Amazon;
